import React from 'react';

class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: '',
      password: '',
    };
  }

  render() {
    return (
      <div>
        <div>
          <input
            type="text"
            name="email"
            onChange={ ({ name, value }) => this.setState({ [name]: value }) }
            placeholder="email"
          />
        </div>
      </div>
    );
  }
}

export default Login;
